import React, { Component } from 'react';

class Contact extends Component {
  render() {
    return (
      <div>
          Contact

          <button type="button" class="btn btn-primary">Accept</button>
          <button type="button" class="btn btn-danger">Deny</button>
      </div>
    );
  }
}

export default Contact;
